import React from 'react'
import Header from '../Components/Header/Header'
import Car from '../Components/Cart/Cart'

function AddTCartPage() {
  return (
    <div>
        <Header></Header>
        <Cart></Cart>
    </div>
  )
}

export default AddTCartPage
